Hanging out in my youth and getting to collaborate with these guys was insane but looking back even more than could have imagined man so grateful for my time with them me and @stayhigh149 i did a mural for @haroldhunterfoundation  my best homi who had passed away now all of em are passed away . So greatful for @frankschopshop  which was the hangout man respect to all the fallen generals of  NYC who made it what it is 🙏 it was an honor to be with them 🔥❤️🔥. If you dont know who these cats are look em up and educate yourself instagram heads dont give no props to their mentors all about themselves and business its a joke man dont forget people put you on inspired you
